import React from "react";
import { Route, Switch, withRouter } from "react-router-dom";
import { connect } from "react-redux";
import Header from "../components/Header/index";
import Sidebar from "../containers/SideNav/index";
import Footer from "../components/Footer";
import Administration from "./routes/Administration/index";
import RegistreAppel from "./routes/RegistreAppel/Registre";
import Calendar from "./routes/Calendar/index";
import Mail from "./routes/Mail/Mail";
import Devoir from "./routes/todo/Devoir/Homework";
import Home from "./routes/Home/index";
import Profile from "./routes/Profile/index";
import BilletPass from "./routes/BilletPass/BilletPass";
import LevelTest from "./routes/LevelTest/LevelTest";
import { getUserProfile } from "../actions/Auth";
import {
  ABOVE_THE_HEADER,
  BELOW_THE_HEADER,
  COLLAPSED_DRAWER,
  FIXED_DRAWER,
  HORIZONTAL_NAVIGATION
} from "../constants/ActionTypes";
import { isIOS, isMobile } from "react-device-detect";
import asyncComponent from "../util/asyncComponent";
import TopNav from "../components/TopNav";
import Complaint from "./routes/Complaint/Complaint";
import Cafeteria from "./routes/Cafeteria/index";
import HealthMonitoring from "./routes/HealthMonitoring/HealthMonitoring";
import Learning from "./routes/Learning/index";
import GradesMenu from "./routes/GradesMenu/index";
import Can from "../can";
import { RoleContext } from "../Context";
import Lesson from "./routes/Lesson/Lesson";
import VirtualClasses from "./routes/VirtualClasses/VirtualClasses";
import Community from "./routes/Community/index";
import Dashboard from "./routes/Dashboard/index"
import Libraries from "./routes/Libraries/index";
import FinancialManagement from "./routes/FinancialManagement/index";
import Superadmin from "./routes/Superadmin/index"

const RouteControl = ({ pathName, estabModule, Component, match }) => {
  return (
    <RoleContext.Consumer>
      {({ role }) => (
        <Can
          role={role}
          perform={`module-nav-${pathName}`}
          yes={() => (
            <Can
              role={role}
              perform="module-nav-access"
              data={{
                mod: pathName,
                moduleList: estabModule
              }}
              yes={() => <Component match={match} />}
              no={() => (
                <Route
                  component={asyncComponent(() =>
                    import("../components/Error404")
                  )}
                />
              )}
            />
          )}
          no={() => (
            <Route
              component={asyncComponent(() => import("../components/Error404"))}
            />
          )}
        />
      )}
    </RoleContext.Consumer>
  );
};
class App extends React.Component {
  state = {
    load: false
  };
  componentDidMount() {
    const user = localStorage.getItem("user_id");
    this.props.dispatch(getUserProfile(parseInt(user)));
  }
  render() {
    const {
      match,
      drawerType,
      navigationStyle,
      horizontalNavPosition,
      estabModule
    } = this.props;
    const drawerStyle = drawerType.includes(FIXED_DRAWER)
      ? "fixed-drawer"
      : drawerType.includes(COLLAPSED_DRAWER)
        ? "collapsible-drawer"
        : "mini-drawer";
    //set default height and overflow for iOS mobile Safari 10+ support.
    if (isIOS && isMobile) {
      document.body.classList.add("ios-mobile-view-height");
    } else if (document.body.classList.contains("ios-mobile-view-height")) {
      document.body.classList.remove("ios-mobile-view-height");
    }
    return (
      <div className={`app-container ${drawerStyle}`}>
        <Sidebar estabModule={this.props.estabModule} />
        <div className="app-main-container bg-white">
          <div
            className={`app-header ${
              navigationStyle === HORIZONTAL_NAVIGATION
                ? "app-header-horizontal"
                : ""
              }`}
          >
            {navigationStyle === HORIZONTAL_NAVIGATION &&
              horizontalNavPosition === ABOVE_THE_HEADER && (
                <TopNav styleName="app-top-header" />
              )}
            <Header />
            {navigationStyle === HORIZONTAL_NAVIGATION &&
              horizontalNavPosition === BELOW_THE_HEADER && <TopNav />}
          </div>

          <main className="app-main-content-wrapper">
            <div className="app-main-content">
              <Switch>
                <Route path={`${match.url}/profile`} component={Profile} />
                <Route
                  path={`${match.url}/home`}
                  render={props => (
                    <Home
                      {...props}
                    />
                  )}
                />
                <Route
                  path={`${match.url}/administration`}
                  render={props => (
                    <Administration
                      match={match}
                      estabModule={estabModule}
                      {...props}
                    />
                  )}
                />
                  <Route
                  path={`${match.url}/superadmin`}
                  render={props => (
                    <Superadmin
                      match={match}
                      estabModule={estabModule}
                      {...props}
                    />
                  )}
                />

                <Route
                  path={`${match.url}/gradesmenu`}
                  render={props => (
                    <GradesMenu
                      match={match}
                      estabModule={estabModule}
                      {...props}
                    />
                  )}
                />
                <Route
                  path={`${match.url}/calendar`}
                  render={props => (
                    <Calendar
                      match={match}
                      estabModule={estabModule}
                      {...props}
                    />
                  )}
                />

                <Route
                  path={`${match.url}/financial_management`}
                  render={props => (
                    <FinancialManagement
                      match={match}
                      estabModule={estabModule}
                      {...props}
                    />
                  )}
                />
                <Route
                  path={`${match.url}/billetPass`}
                  render={() => (
                    <RouteControl
                      pathName={"billetPass"}
                      estabModule={estabModule}
                      Component={BilletPass}
                      match={match}
                    />
                  )}
                />
                <Route
                  path={`${match.url}/complaints`}
